// https://api.mfapi.in/mf/100049

import { useEffect, useState } from "react"
function App(){
  const [data,setData]=useState ()
  useEffect(()=>{
    fetch("https://api.mfapi.in/mf/100049")
    .then((res)=>{
       return res.json
    })
    .then((resp)=>{
        console.log(resp)
        setData(resp)
    })
}, [])
return(
    <div>
        <h2>Chart</h2>
        <table>
          <thead>
            <tr>
            <th>Date</th>
            <th>Nav</th>
            </tr>
          </thead>
          <tbody>
            {data?.map((item)=>{
            <tr>
              <td>{item.date}</td>
              <td>{item.nav}</td>
            </tr>
              })}
          </tbody>
        </table>
    </div>
)
}

export default App;
